[{"sha":"081098ee7639211687db7d369aa172029572e7dd","author":{"name":"Ken Franko","email":"99675e19a4e19629720cc97f93d3a35dad14ac72@google.com"},"message":"Don't move after ops that haven't been moved when merging IfRegion ops.

Previously there was a bug where:
%1 = "tf.IfRegion"(%0) ( {
  %3 = "tf.A"() : () -> (tensor<f32>)
  "tf.Yield"(%3) : (tensor<f32>) -> ()
  }, {
  %3 = "tf.C"() : () -> (tensor<f32>)
  "tf.Yield"(%3) : (tensor<f32>) -> ()
 }) { is_stateless = true } : (tensor<i1>) -> (tensor<f32>)
"tf.AssignVariableOp"(%arg0, %1) : (tensor<!tf.resource<tensor<f32>>>, tensor<f32>) -> ()
%4 = "tf.Const"() {value = dense<1.0> : tensor<f32>} : () -> (tensor<f32>)
%5 = "tf.IfRegion"(%0) ( {
  %3 = "tf.B"(%4) : (tensor<f32>) -> (tensor<i32>)
  "tf.Yield"(%3) : (tensor<i32>) -> ()
  }, {
  %3 = "tf.D"(%4) : (tensor<f32>) -> (tensor<i32>)
  "tf.Yield"(%3) : (tensor<i32>) -> ()
 }) { is_stateless = true } : (tensor<i1>) -> (tensor<i32>)
%6 = "tf.E"(%5) : (tensor<i32>) -> (tensor<f32>)
"tf.F"(%1, %6) : (tensor<f32>, tensor<f32>) -> ()
tf_device.return %1 : tensor<f32>

could result in "tf.AssignVariableOp" being moved after tf_device.return %1 which later resulted in a segfault.

This change ensures that ops are correctly moved after the second merge IfRegion only when necessary and in the correct order.

